import React, {Component} from 'react';
import "./css/nav.css";

class Navbar extends Component {
    render(){
        return(
            <section class="section intro">
            <div class="container">
            <h1>멀티캠퍼스 블라인드</h1>
            </div>
            </section>
        );
    }
}


export default Navbar;
